import React from 'react'
import Model from "./model/model"

const Table = () => {
    const model = Model();
    return (
        <div>
            <table>
                <tr>
            {model.map(column =>(
                   <th>{column}</th>
            ))}
                </tr>
            </table>
        </div>
    )
}

export default Table
